import { useNavigate } from "react-router-dom";
import brave4Image from "../styles/images/brave4.jpeg";

const Contentt = () => {
    const navigate =  useNavigate();
    return(
        <div className="container center">
            <h3>Contentt</h3>
            <div className="foto">
                <img src={brave4Image} alt="" />
            </div>
            <button className="kembali" onClick={()=> navigate('/')}>Cover</button>
        </div>
    )
};

export default Contentt;
